    TwentyFivePlayers.forEach(player => {
    player.monthlyData.forEach(month => {
      // Calculate appearances
      month.appearances = month.wins + month.draws + month.losses;
  
      // Calculate points
      month.points = month.wins * 3 + month.draws;
    });
  
    // Optional: Calculate total appearances and points for the season
    player.totalAppearances = player.monthlyData.reduce((acc, month) => acc + month.appearances, 0);
    player.totalPoints = player.monthlyData.reduce((acc, month) => acc + month.points, 0);
  });
  
  TwentyFivePlayers.forEach(player => {
    // Reset the "overall" month data
    const overall = {
      month: "overall",
      appearances: 0,
      wins: 0,
      draws: 0,
      losses: 0,
      points: 0,
      goals: 0,
      assists: 0,
      win_percentage: 0,
      unbeaten_percentage: 0,
      own_goals: 0,
      slingers: 0,
      penalties: 0,
      hatricks: 0,
      yellow_cards: 0,
      red_cards: 0,
      clean_sheets: 0,
      motm: 0,
    };
  
    // Iterate over monthlyData to calculate totals
    player.monthlyData.forEach(month => {
      // Skip the overall month in case it's already there
      if (month.month === "overall") return;
  
      // Sum up numeric properties
      overall.appearances += month.wins + month.draws + month.losses;
      overall.wins += month.wins;
      overall.draws += month.draws;
      overall.losses += month.losses;
      overall.points += month.wins * 3 + month.draws;
      overall.goals += month.goals;
      overall.assists += month.assists;
      overall.own_goals += month.own_goals;
      overall.slingers += month.slingers;
      overall.penalties += month.penalties;
      overall.hatricks += month.hatricks;
      overall.yellow_cards += month.yellow_cards;
      overall.red_cards += month.red_cards;
      overall.clean_sheets += month.clean_sheets;
      overall.motm += month.motm;
    });
  
    // Calculate percentages
    const totalMatches = overall.wins + overall.draws + overall.losses;
    overall.win_percentage = totalMatches ? (overall.wins / totalMatches) * 100 : 0;
    overall.unbeaten_percentage = totalMatches ? ((overall.wins + overall.draws) / totalMatches) * 100 : 0;
  
    // Replace or add the overall month in the player's monthlyData
    const overallIndex = player.monthlyData.findIndex(month => month.month === "overall");
    if (overallIndex !== -1) {
      player.monthlyData[overallIndex] = overall;
    } else {
      player.monthlyData.push(overall);
    }
  });  
  
  
